;\">2.4用户同意，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">拥有通过邮件、短信、电话、客户端推送等形式，向本平台用户发送订单信息、促销活动、关注内容、相关评论转发等信息的权利。如果用户认为被打扰，有选择拒绝接受相关信息的权利。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">2.5用户不得将在本平台注册获得的账户借给他人使用，否则用户应承担由此产生的全部责任，并与实际使用人承担连带责任。</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">2.6用户同意，发生法律法规及个人信息保护政策规定的情形时，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">有权使用用户的注册信息、用户名、密码等信息，登录进入用户的注册账户，进行证据保全，包括但不限于公证、见证等。</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">2.7用户对其账户项下所有的行为及相应的结果（包括但不限于在线签署各类协议、发布信息、网络直播、购买商品及服务及披露信息等）负责。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">2.8用户如发现任何未经授权使用其账户登录本平台或其他可能导致您其账户遭窃、遗失的情况，建议用户立即通知</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">。用户应理解快乐购对其任何请求采取行动均需要合理时间，除快乐购存在过错外，快乐购对用户账户遭窃、遗失所产生的后果不承担任何责任。</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">2.9原则上每个手机号码、每个收货地址仅对应一个用户账户。 除本协议另有约定外，如出现以下行为，则视为虚假注册：</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（1）以同一手机号码注册多个账户；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（2）多个账户使用同一收货地址或同一<span style=\"font-family: &quot;Times New Roman&quot;;\">IP</span>地址；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（3）其他使用同一手机账户或同一收货地址、<span style=\"font-family: &quot;Times New Roman&quot;;\">IP</span>地址注册多个账户的行为；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">有权将上述多账户认定为一个用户账户。</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">有权终止虚假注册账户在</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">上消费及使用其他功能的权利。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">用户信息的使用及管理具体详见《快乐购个人信息保护政策》。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">第3条 平台服务</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">3.1</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">通过互联网依法为用户提供商品、互联网信息等服务，用户在完全同意本协议及本平台规定的情况下，方有权使用本平台的相关服务。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">3.2用户必须自行准备如下设备和承担如下费用：（</span><span style=\"font-size: 14px; font-family: &quot;Times New Roman&quot;;\">1</span><span style=\"font-family: 宋体; font-size: 14px;\">）上网设备，包括并不限于电脑或者其他上网终端、调制解调器及其他必备的上网装置等；（</span><span style=\"font-size: 14px; font-family: &quot;Times New Roman&quot;;\">2</span><span style=\"font-family: 宋体; font-size: 14px;\">）上网费用，包括并不限于网络接入费、上网设备租用费、手机流量费等。</span><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">第4条 商品信息</span><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">本平台上的商品价格、数量、是否有货等商品信息随时都有可能发生变动，您应自行关注，本平台不作特别通知。由于平台上商品信息的数量极其庞大，虽然本平台会尽最大努力保证您所浏览商品信息的准确性，但由于众所周知的互联网技术因素等客观原因存在，本平台显示的信息可能会有一定的滞后性或偏差，对此情形您知悉并理解。为表述便利，商品和服务简称为&quot;商品</span><span style=\"font-size: 14px; font-family: &quot;Times New Roman&quot;;\">&quot;</span><span style=\"font-family: 宋体; font-size: 14px;\">或</span><span style=\"font-size: 14px; font-family: &quot;Times New Roman&quot;;\">&quot;</span><span style=\"font-family: 宋体; font-size: 14px;\">货物</span><span style=\"font-size: 14px; font-family: &quot;Times New Roman&quot;;\">&quot;</span><span style=\"font-family: 宋体; font-size: 14px;\">。</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">第5条 订单</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">5.1在您下订单时，请您仔细确认所购商品的名称、数量、型号、规格、尺寸、价格及支付方式、收货人、收货地址、联系方式等信息。收货人与用户本人不一致的，收货人的行为和意思表示将视为用户的行为和意思表示，用户应对收货人的行为及意思表示的法律后果承担连带责任。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">5.2&nbsp;如果您通过本网站订购商品，本网站上展示的商品和价格等信息仅仅是要约邀请，您的订单将成为订购商品的要约。收到您的订单后，我们将向您发送信息确认我们已收到您的订单，其中会注明订单的细节，但该确认不代表我们接受您的订单。只有当我们向您发出发货确认的信息，才构成我们对您的订单的接受，我们和您之间的订购合同才成立。如果您在一份订单里订购了多种商品，而我们只向您发出了其中部分商品的发货确认信息，那么我们和您之间的订购合同仅就该部分商品成立。但对于电子书、数字音乐、在线手机充值等数字化商品，您下单并支付货款后合同即成立。您可以随时登陆您在本站注册的账户，查询您的订单状态。</span><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">5.3由于市场变化及各种以合理商业努力难以控制的因素的影响，本平台无法保证您提交的订单信息中希望购买的商品都会有货；在接收到您的订单后，如果发现您所订购的商品全部或部分缺货，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">经营者会就缺货的商品详细情况与您联系，并提供您选择的机会来取消整个订单或用代替商品以替换缺货的物品来变更订单。如果您在客服和您约定的时间内没有取消订单，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">经营者有权向您送达部分有货的商品或者在您订购的商品全部无货的情况下取消该订单。</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">5.4&nbsp;您充分理解并完全同意：</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">提供的购物服务仅面向消费者，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">根据您账号下的商品购买记录及其他相关信息，如果发现您通过本网站或者</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">提供的其他网购渠道购买的商品并非用于您个人消费或者使用用途的，对于您的这个用户账号的商品购买需求，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">有权不予接受；您如果已经下达订单，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体;