ng: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（9）不得发布任何侵犯他人著作权、商标权等知识产权或合法权利的内容；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">用户应关注并遵守本平台不时公布或修改的各类合法规则规定。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">若用户未遵守以上规定的，本平台有权作出独立判断并采取暂停或关闭用户帐号等措施。用户须对自己在本平台上的言论和行为承担法律责任。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">本平台保留删除平台内各类不符合法律、政策或不实信息而无须通知用户的权利。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">第8条 配送</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">8.1您充分理解并完全同意：本平台销售的商品存在由</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">以外的其他提供商品在本平台进行销售的经营者销售并配送的情形。订单生成后，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">经营者将会把商品（货物）送到您所指定的收货地址，所有在本平台上列出的送货时间为参考时