(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">第10条 交易争议处理</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\">您在本平台交易过程中发生争议的，您有权选择以下途径解决：</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（1）与争议相对方自主协商；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（2）请</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">协助调解；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（3）请求消费者协会或者其他依法成立的调解组织调解；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（4）向有关行政部门投诉；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（5）根据与争议相对方达成的仲裁协议（如有）提请仲裁；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">（6）向人民法院提起诉讼。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">当您通过</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">协助调解时，如果对</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">的调解结果不满，您仍有权采取其他争议处理途径解决争议。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">第11条 所有权及知识产权条款</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;\">11.1用户一旦接受本协议，即表明该用户主动将其在任何时间段在本平台发表的任何形式的信息内容（包括但不限于客户评价、客户咨询、各类话题文章等信息内容）的财产性权利等任何可转让的权利，包括并不限于：复制权、发行权、出租权、展览权、表演权、放映权、广播权、信息网络传播权、摄制权、改编权、翻译权、汇编权以及应当由著作权人享有的其他可转让权利，全部独家且不可撤销地转让给快乐购，用户同意</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">有权就任何第三方主体侵犯上述权利而单独提起诉讼。</span><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 宋体; font-size: 14px;