amily: 宋体; font-size: 14px;\">15.4您点击本协议下方的<span style=\"font-family: &quot;Times New Roman&quot;;\">&quot;</span>同意并继续<span style=\"font-family: &quot;Times New Roman&quot;;\">&quot;</span>按钮即视为您完全接受本协议，在点击之前请您再次确认已知悉并完全理解本协议的全部内容。</span></p>','',0,5,1,'','','',1663339788,1663401080),(40,'货到付款',25,'','',1,'<p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">目前我们在已经开通全国地区可以提供货到付款服务，您无需预先支付货款，只需先通过网站、App、微信或电话订购，在收到商品时再支付商品货款即可。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">Q:我们的配送范围是哪些地区？</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">A:（一）全国省会城市可以配送；</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">（二）可配送到县城的地区有：</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">1、湖南省：全境到县城。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">2、湖北省：荆州、荆门全境到县城。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">3、广西省：全境到地市。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">4、广东省：广州到县（番禺、花都、增城等）、东莞全境到村，珠海市、湛江市到县城、韶关和清远城区范围内、河源仅源城区内、肇庆市市区及德庆县、封开县、广宁县、怀集县城区、深圳深圳全市市区范围内均可配送，除极其偏远的乡村不可配送。 5、江苏省：南京、扬州、泰州、徐州南通市区内（目前不能送到周边县城），昆山全境到村。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">6、浙江省：宁波全境到镇，台州、金华、绍兴全境到县城。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">7、福建省：泉州全境到村、宁德全境到县城。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">8、山西省：太原、晋城全境到县城。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">9、天津市：全境到县城。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\">10、江西省：九江县沙河街镇、德安县城区、共青城、彭泽县城区、瑞昌市湓城街道、桂林街道及九江市市区。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><br/></p><p><br/></p>','',0,3,1,'','','',1663341828,1663401080),(41,'配送费用',25,'','',1,'<p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">下单时填写了收货地址之后，系统会默认为您选择我们的合作快递公司发货。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">1.港、澳、台及海外暂不支持配送。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">2.全国可配送区域中除开内蒙古、新疆外均可7天可送货到府（新疆、内蒙古15天可全部送达）。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">3.凡是用户使用在线支付且商品重量在5KG以内，由圆通快递配送。</p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">4.第三方发货订单由代发货方合作快递公司发货，且不支持货到付款。</p><p><br/></p>','',0,4,1,'','','',1663341908,1663401082),(42,'收货须知',25,'','',1,'<p><span style=\"color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; background-color: rgb(255, 255, 255);\">已付款的买家请注意,请务必本人签收,并且先验货后再签收; 如发现商品质量或数量有问题,请拒绝签收,将包裹退回并及时与我们联系</span></p>','',0,4,1,'','','',1663341963,1663401083),(43,'售后服务',27,'','',1,'<p><span style=\"color: rgb(68, 68, 68); font-family: Arial, 微软雅黑, 宋体; background-color: rgb(255, 255, 255);\">温馨提示：卖家发货后的20天内您可以申请【退款/退货】，交易成功后15天内若您对商品存在异议，可以发起【申请售后】进行维权。如果已经超过该期限，需要自行通过官方联系方式沟通，协商处理。</span></p>','',0,17,1,'','','',1663400967,1663401083),(44,'投诉建议',27,'','',1,'<p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75; color: rgb(68, 68, 68); font-famil