。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">8.2因如下情况造成订单延迟或无法配送等，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">经营者不承担延迟配送的责任：</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">（1）用户提供的信息错误、地址不详细等原因导致的；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">（2）货物送达后无人签收，导致无法配送或延迟配送的；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">（3）情势变更因素导致的；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">（4）不可抗力因素导致的，例如：自然灾害、交通戒严、突发战争等；</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">（5）其他非销售方或</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">原因导致的订单迟延或无法配送的。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">第9条 内容创作、信息分享</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">9.1&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">鼓励用户充分利用本平台自由地发布和共享自己的信息或进行互动交流，但不得违反相关法律法律或本平台规则的规定，亦不得通过本平台发布他人享有知识产权的内容，除非获得他人的合法授权。就用户发布的内容，若第三方向本平台投诉并提交初步证据，经</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">判断投诉属实的，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">会删除这些内容并不承担任何责任。如因用户发布的内容给</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">带来损失的，用户应当予以赔偿。同时用户同意并遵守本平台发布的其他具体规范。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">9.2&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">有权对用户使用平台情况进行审查和监督，如用户在使用本平台时违反上述规定，</span><span style=\"font-family: 宋体; font-size: 14px;\">醇贵</span><span style=\"font-family: 宋体; font-size: 14px;\">或其授权的人有权要求用户改正或直接采取一切必要的措施（包括但不限于更改或删除用户发布的内容、暂停或终止用户使用本平台的权利）以减轻用户不当行为造成的影响。</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">第10条 交易争议处理</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0.5em; margin-bottom: 0.5em; padding: 0px; line-height: 1.75;\"><span style=\"font-family: 宋体; font-size: 14px;\">&nbsp;</span></p>